import Score from "../comp/module/Score";
import mole from "../core/Mole";

const ModalResult = () => {
    const scoreSplit = () => {
        const list = [];
        for(let i=0; i<mole.getState('score').toString().length; i++) {
            list.push(i);
        }
        return list;
    }
    return (
        <div className="score-result">
            <h1>
                <span>S</span>
                <span>C</span>
                <span>O</span>
                <span>R</span>
                <span>E</span>
                <br/>
                {
                    scoreSplit().map((item) => {
                        return <span>{item}</span>
                    })
                }
            </h1>
        </div>
    )
}

export default ModalResult;
